// src/components/NormalizedTableView.jsx
import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import axios from "axios";

const NormalizedTableView = () => {
  const { tableName } = useParams();
  const [columns, setColumns] = useState([]);
  const [rows, setRows] = useState([]);
  const [error, setError] = useState("");

  useEffect(() => {
    async function fetchData() {
      try {
        const res = await axios.get(`/api/normalized_table_data/${tableName}`);
        if (res.data.error) {
          setError(res.data.error);
          return;
        }
        setColumns(res.data.columns);
        setRows(res.data.rows);
      } catch (err) {
        setError("Failed to fetch table data.");
      }
    }
    fetchData();
  }, [tableName]);

  if (error) {
    return (
      <div style={{ padding: 20 }}>
        <h2>Error loading table: {tableName}</h2>
        <p>{error}</p>
        <Link to="/">← Back to Workflow</Link>
      </div>
    );
  }

  return (
    <div style={{ padding: 20 }}>
      <h2>Normalized Table: {tableName}</h2>
      <div
        style={{
          overflowX: "auto",
          border: "1px solid #ccc",
          borderRadius: 6,
          marginTop: 10,
        }}
      >
        <table
          style={{
            borderCollapse: "collapse",
            width: "100%",
            minWidth: "600px",
          }}
        >
          <thead style={{ backgroundColor: "#4d80b3ff", color: "#fff" }}>
            <tr>
              {columns.map((col) => (
                <th
                  key={col}
                  style={{
                    padding: "8px",
                    border: "1px solid #ddd",
                    whiteSpace: "nowrap",
                    textAlign: "left",
                  }}
                >
                  {col}
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {rows.map((row, i) => (
              <tr
                key={i}
                style={{ backgroundColor: i % 2 === 0 ? "#f9f9f9" : "#fff" }}
              >
                {row.map((cell, j) => (
                  <td
                    key={j}
                    style={{
                      padding: "8px",
                      border: "1px solid #ddd",
                      whiteSpace: "nowrap",
                    }}
                  >
                    {cell ?? ""}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div style={{ marginTop: 20 }}>
        <Link to="/">← Back to Workflow</Link>
      </div>
    </div>
  );
};

export default NormalizedTableView;
